  menuToggle.classList.toggle('active');
  showcase.classList.toggle('active');
})
  return (
    <div>
      <div className="container">
        <article>
          <h1>Hi, I'm Jeff</h1>
          A Full-Stack Web Developer 
        </article>
      </div>
    </div>
  );
}

export default App
